import React from 'react';
import styles from './Header.module.scss';

const Header = ({ summaryInfo }) => (
  <header>
    <h1 className={styles.title}>ShopApp</h1>
    {summaryInfo && (
      <div >
        <span>Name: {summaryInfo.name}</span>
        <span>Title: {summaryInfo.title}</span>
        <span>Total Price: {summaryInfo.totalPrice}</span>
        <span>Size: {summaryInfo.size}</span>
        <span>Color: {summaryInfo.color}</span>
      </div>
    )}
  </header>
);

export default Header;
